const mongoose = require("mongoose");

const motorcycleSchema = new mongoose.Schema({
  name: { 
    type: String, 
    required: true, 
    unique: true  // Đảm bảo mỗi phân loại là duy nhất
  },
  description: { 
    type: String 
  }
}, { timestamps: true });

module.exports = mongoose.model("Category", categorySchema);
